import React, { useState, useEffect } from "react";
import {useHistory, useParams} from 'react-router-dom'
import Nav from "../nav/nav"
import '../../style.css';
import 'bootstrap/dist/css/bootstrap.min.css';
// import AddResumeData from "./AddResumeData";


const ViewResume = () => {

    const [resumeData, setResumeData] = useState([]);


    const data = {
      data: resumeData
  }

    // const history = useHistory();

    // const resumeInfo = {
    //     patientID:id, 
    //     careproviderID: careprovider
    // }

    // const resumeInfoEdit = {
    //     patientID:id, 
    //     patientEditID: patientEdit
    // }


  useEffect(() => {

    async function fetchData() {
      const res = await fetch(`http://localhost:4000/projects`);
      res.json().then((res) => setResumeData(res));

    }
    fetchData();
  });

  return (
    <div>
      <Nav />
        <h2 className="work-h2">My Projects</h2>
        {/* <AddResumeData data={resumeData} /> */}
        <section className="resume">
            {resumeData.map((data) =>
                <div className="work-div">
                    <h3>{data.name}</h3>
                    <h4>{data.desc}</h4>
                    <h5>{data.img}</h5>
                    <ul>
                        <li>{data.link}</li>
                    </ul>
                    <hr className="work-seperation" />
                </div>
            )}
        </section>
    </div>
  );
};

export default ViewResume;
